Case set for sentencing hearing. Parties are prepared to proceed. Newspaper article submitted by the defense received and filed. PSI reviewed by the parties. Statements made as to sentencing. Additional statements made by James F., Courtney W. 

As to COUNT 1-
The Court sentenced the defendant to a MAXIMUM TERM OF IMPRISONMENT of 54 MONTHS, with credit for 13 days time served; the INITIAL TERM OF CONFINEMENT in the Wisconsin State Prison System is 18 MONTHS; the MAXIMUM TERM OF EXTENDED SUPERVISION is 36 MONTHS.  

Defendant is NOT eligible for the Challenge Incarceration Program or the Earned Release Program. The defendant is not appropriate for the Substance Abuse Program.

Court costs, fees, surcharges and restitution be paid through collection by the department of Corrections from 25% of funds under Sec. 973.05(4)(b) and as a condition of extended supervision.

Conditions of Extended Supervision:
1) Maintain absolute sobriety;
2) Any prescription medication to be provided to the agent PRIOR to filling it;
3) AODA assessment and comply with any recommended treatment;
4) Do not use, possess, sell or distribute illegal drugs. No association with any place where drugs are used, packaged or sold;
5) Participate in drug tests;
6) Do not possess any prescriptions medications without a prescription;
7) Provide DNA sample (unless previously submitted) and pay surcharge;
8) Pay all costs, fees and surcharges. Failure to pay will result in a civil judgment;
9) Court set restitution at $3,789.00 to be paid to James F. Restitution to be paid FIRST before costs, fees and surcharges. 

Bail on deposit to be applied to restitution FIRST. Remainder of bail to be returned to poster. 

Pursuant to Wisconsin Statutes section 973.176, the Court advised the defendant of the following restrictions:  Firearm possession; Voting 

